const state = {
  //属性
  userInfo: null
}

const mutations = {
  //改变
  hanldeUserInfo(state, userInfo) {
    state.userInfo = userInfo
  }
}

const actions = {
  //事件
  actionUserInfo({ commit }){
    // 调用commit方法来提交mutation
    commit('hanldeUserInfo', {"name":'ccsh'})
  }
}

export default {
  namespaced: true,
  state,
  mutations,
  actions
}
